sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
    // verify that the API gets called properly 
    if(inputs.status_code == '200') {

        var responseBody = JSON.parse(inputs.response_body);

        outputs.host = responseBody.hostname;
        outputs.city = responseBody.city;
        outputs.region = responseBody.region;
        outputs.country = responseBody.country;
        outputs.postal = responseBody.postal;

        // split loc into 2 so we can seperate latitude and longitude
        var localArray = responseBody.loc.split(',');
        
        outputs.latitude = localArray[0];
        outputs.longitude = localArray[1];

    }
})(inputs, outputs);

